import React, { useEffect, useState } from 'react';
import axios from 'axios';

const App = () => {
  const [players, setPlayers] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/players/')
      .then(response => {
        setPlayers(response.data);
      })
      .catch(error => {
        console.error("There was an error fetching the player data!", error);
      });
  }, []);

  return (
    <div className="App"><h1>Baseball Hitter Statistics</h1><table><thead><tr><th>Name</th><th>Team</th><th>Position</th><th>Games Played</th><th>Batting Average</th><th>Home Runs</th><th>Singles</th><th>Doubles</th><th>Triples</th><th>Strikeouts</th><th>Walks</th></tr></thead><tbody>
          {players.map((player, index) => (
            <tr key={index}><td>{player.name}</td><td>{player.team}</td><td>{player.position}</td><td>{player.games_played}</td><td>{player.batting_average}</td><td>{player.home_runs}</td><td>{player.singles}</td><td>{player.doubles}</td><td>{player.triples}</td><td>{player.strikeouts}</td><td>{player.walks}</td></tr>
          ))}
        </tbody></table></div>
  );
}

export default App;
